struct GLFONT {
	
	int h, w;
	GLTEX texti, textb;
	std::vector<int> cs;
	
	GLFONT(const int *C = LiberationSansRegular) {
		
		for (int i=0; i<96; i++)
			cs.push_back(C[2+i]);
		
		cv::Mat1b rawimg(C[1], C[0]);
		int c=2+96;
		int l=0, v=0;
		l = C[c]/16; v=17*(C[c]%16); c++;
		for (int j=0; j<rawimg.cols; j++)
			for (int i=0; i<rawimg.rows; i++)
				if (l--) rawimg(i,j)=255-v;
				else { rawimg(i,j)=255-v; l=C[c]/16; v=17*(C[c]%16); c++; }

		h = rawimg.rows/96;
		w = rawimg.cols;

		cv::Mat1b img = cv::Mat1b(h*16, w*8, uint8_t(0));
		for (int i=0; i<16; i++)
			for (int j=0; j<8; j++)
				if (i*8+j<96)
					img(cv::Rect(j*w, i*h*4/3, w, h)) += rawimg(cv::Rect(0, (i*8+j)*h, w, h));
	
		cv::Mat1b circle(w/8,w/8,uint8_t(0));
		cv::circle(circle, cv::Point2d(w/16, w/16), w/16, cv::Scalar(1),-1);
		cv::Mat1b bimg = img.clone();
		cv::dilate(bimg, bimg, circle);

		cv::Mat4b timg(img.rows, img.cols, cv::Vec4b(255,255,255,0));
		cv::Mat4b tbimg(img.rows, img.cols, cv::Vec4b(0,0,0,0));
		for (int i=0; i<img.rows; i++)
			for (int j=0; j<img.cols; j++)
				{ timg(i,j)[3]=img(i,j); tbimg(i,j)[3]=bimg(i,j); }
				
		texti = GLTEX(timg, true);
		textb = GLTEX(tbimg, true);
	}
	
	~GLFONT() {};

	void draw(std::string s) {
		
		textb();
		float t = 0.;
		glBegin(GL_QUADS);
		for (auto c : s) {
			c = std::min(std::max(c-32,0),95);
			float cx = (c%8)/8.f, cy = (c/8)/12.f+1/256.f, tx = 1/8.f, ty = 1/16.f;
			glTexCoord2f( cx+tx, cy+ty ); glVertex3f(t+(1.f*w)/h,1,0);
			glTexCoord2f( cx+tx, cy    ); glVertex3f(t+(1.f*w)/h,0,0);
			glTexCoord2f( cx   , cy    ); glVertex3f(t,0,0);
			glTexCoord2f( cx   , cy+ty ); glVertex3f(t,1,0);
			t+=std::max(w/8,cs[c]-w/6)/float(h);
		}
		glEnd();
		texti();
		t=0;
		glBegin(GL_QUADS);
		for (auto c : s) {
			c = std::min(std::max(c-32,0),95);
			float cx = (c%8)/8.f, cy = (c/8)/12.f+1/256.f, tx = 1/8.f, ty = 1/16.f;
			glTexCoord2f( cx+tx, cy+ty ); glVertex3f(t+(1.f*w)/h,1,0);
			glTexCoord2f( cx+tx, cy    ); glVertex3f(t+(1.f*w)/h,0,0);
			glTexCoord2f( cx   , cy    ); glVertex3f(t,0,0);
			glTexCoord2f( cx   , cy+ty ); glVertex3f(t,1,0);
			t+=std::max(w/8,cs[c]-w/6)/float(h);
		}
		glEnd();
		glTranslatef(0, 1, 0);
	}
	
	void drawCentered(std::string s) {
		float t=0;
		for (auto c : s) {
			c = std::min(std::max(c-32,0),95);
			t+=std::max(w/8,cs[c]-w/6)/float(h);
		}
		glTranslatef(-t/2-(w/float(6*h)),-.5,0);
		draw(s);
	}
};
